/* eslint-disable jsx-a11y/anchor-is-valid */
/* eslint-disable jsx-a11y/anchor-has-content */
import React, { Component } from 'react';

class Test extends Component {
    render() {
        return (
            <>
                <nav>
                <Link to="/test">Test
                <Routes>
                    <Route path="/test" element={<Test />} />
                </Routes></Link>
                </nav>
            </>
        );
    }
}

export default Test;
